import React from "react";
import OtherHalfWindowLeftImage from './res/otherhalfwindowleft.jpg';
import './Tile.css'

const OtherHalfWindowLeft = () => {
    return (
        <img className="myTileImg" src={OtherHalfWindowLeftImage}/>
    )
};

export default OtherHalfWindowLeft;
